$(document).ready(function(){(function(){var c=[];var d;var b=300;var e=500;var a="on";function f(){$.ajax({data:{data:"cpu_usage"},dataType:"json",success:function(g){$.each(g,function(j,h){if(c[j]==undefined){var m=[];for(var l=1;l<=b;l++){m.push([l,0])}c[j]={label:" CPU"+j,data:m}}else{for(var l=0;l<b-1;l++){c[j]["data"][l]=[l+1,c[j]["data"][l+1][1]]}c[j]["data"][b-1]=([b,h*100])}});if(!d){d=$.plot("#cpu-usage .chart",c,{grid:{borderColor:"#f3f3f3",borderWidth:1,tickColor:"#f3f3f3"},series:{shadowSize:0},lines:{},yaxis:{min:0,max:100,show:true},xaxis:{show:false}})}else{d.setData(c);d.draw()}if(a=="on"){setTimeout(f,e)}}})}if(a==="on"){f()}$("#cpu-usage .realtime .btn").click(function(){if($(this).data("toggle")==="on"){a="on";f()}else{a="off"}})})();(function(){var c;var d;var b=300;var e=500;var a="on";function f(){$.ajax({data:{data:"memory_usage"},success:function(g){if(!c){c=[];for(var h=1;h<=b;h++){c.push([h,0])}}else{for(var h=0;h<b-1;h++){c[h]=[h+1,c[h+1][1]]}c[b-1]=[b,parseFloat(g)*100]}if(!d){d=$.plot("#memory-usage .chart",[c],{grid:{borderColor:"#f3f3f3",borderWidth:1,tickColor:"#f3f3f3"},series:{shadowSize:0,color:"#3c8dbc"},lines:{color:"#3c8dbc"},yaxis:{min:0,max:100,show:true},xaxis:{show:false}})}else{d.setData([c]);d.draw()}if(a=="on"){setTimeout(f,e)}}})}if(a==="on"){f()}$("#memory-usage .realtime .btn").click(function(){if($(this).data("toggle")==="on"){a="on";f()}else{a="off"}})})()});